import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click on a "Your Profile" link.
    // Using a text-based locator and selecting the last instance to ensure a different approach.
    const profileLink = page.locator('a:has-text("Your Profile")').last();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    // Wait for the profile section to be visible after the click
    await page.waitForSelector('.profile-page', { state: 'visible', timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data to verify the action
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.username').textContent();
    const bio = await page.locator('.bio').textContent();

    return {
      success: true,
      action: "Navigated to Jun's Profile page",
      extractedData: {
        fullName: fullName.trim(),
        username: username.trim(),
        bio: bio.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
